export const ROOM = {
  ENTER: 'roomEnter',
  EXIT: 'roomExit',
  END_GAME: 'gameEnd',
  SUBMIT_MOVE: 'submitMove',
  FETCH_ROOMS: 'fetchRooms',
  UPDATE_GAME: 'updateGame',
};

export default ROOM;
